import { Client, GuildEmoji } from "discord.js";

class EmojiData {
  static allEmojis: Map<number, GuildEmoji> = new Map();

  value: string;
  tier: number;
  tierName: string;

  constructor(tier: number, tierName: string, value: string) {
    this.tier = tier;
    this.value = value;
    this.tierName = tierName;
  }

  getValoEmoji(bot: Client): GuildEmoji | undefined {
    if (EmojiData.allEmojis.has(this.tier)) {
      return EmojiData.allEmojis.get(this.tier);
    }
    const result = bot.emojis.cache.find(
      (emoji) =>
        emoji.name === this.name &&
        emoji.guild.id === process.env.EMOJI_GUILD_ID
    );

    EmojiData.allEmojis.set(this.tier, result);
    return result;
  }

  public get name() {
    return `p_valo_t_${this.tierName}`;
  }
}

